import React, { useEffect, useState } from 'react';

function Tag() {
  useEffect(() => {
    fetchItems();
  }, []);

  const handleEdit = (id) => {
    // Handle edit logic using the id
    console.log(`Edit button clicked for ID: ${id}`);
  };

  const handleDelete = (id) => {
    // Handle delete logic using the id
    console.log(`Delete button clicked for ID: ${id}`);
  };

  const [items, setItems] = useState([]);

  const fetchItems = async () => {
    try {
      const response = await fetch('/api/tags/tagData', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
      });
      const data = await response.json();
      setItems(data.data);
    } catch (error) {
      console.error(error);
      // Handle the error, e.g., set an error state or display an error message
    }
  };

  return (
    <form>
      <div className="form-group">
        <label for="exampleInputEmail1">Tag Name</label>
        <input type="text" className="form-control" id="vName" placeholder="Enter Tag Name" />
        <div id="vNameError" className="text-danger" style="display:none">Please Enter Tag Name</div>
      </div>
      <button type="button" className="btn btn-primary">Submit</button>
    </form>
  );
}

export default Tag;
